    false,nt"url": null,nt"notes": "The digital map publication, compiled from
    previously published and unpublished data and new mapping by the author, represents
    the general distribution of surficial and bedrock geology in Pipe Spring National
    Monument and vicinity, including the following 1:24,000-scale U.S. Geological Survey
    (USGS) quadrangles: Moccasin, Kaibab, Pipe Valley, and Pipe Spring. Together with
    the accompanying geologic description pamphlet, it presents current knowledge of
    the geologic structure and stratigraphy of the area covered. The database identifies
    map units that are classified by age and lithology following the stratigraphic nomenclature
    of the USGS. The scale of the source maps limits the spatial resolution (scale)
    of the database to 1:24,000 or smaller. Note: The extent of this database conforms
    to the boundaries of the four quadrangles listed above; however, the topographic
    base maps produced by the USGS for the Moccasin and Kaibab quadrangles extend slightly
    to the north of the 37-degree latitude line that should define the northern limit
    of these 7.5- minute quadrangles. Thus, if this database is overlain with a digital
    file of quadrangle boundaries there is a mismatch.",nt"license_title": null,nt"extras":
